// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PduSessionManager {
    struct Session {
        uint id;
        // Add other session details if necessary
    }

    mapping(uint => Session) public sessions;

    function addSession(uint _id) public {
        sessions[_id] = Session(_id);
    }

    function getSession(uint _id) public view returns (Session memory) {
        require(sessions[_id].id != 0, "Session does not exist");
        return sessions[_id];
    }
}
